INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '2', 'dveloppement.logiciel', '{"x":"D\\u00e9veloppement logiciel","en":"Software development","vn":"Ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '3', 'dfm.est.un.groupe.proposant.des.activits.et.des.services.en.dveloppement.logiciel.ingnierie.scientifique.et.informatique.au.cur.des.enjeux.de.nos.clients.dans.une.relation.de.proximit.nos.experts.assist.de.notre.centre.de.dveloppement.en.asie....', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique. Au c\\u0153ur des enjeux de nos clients, dans une relation de proximit\\u00e9, nos experts assist\\u00e9 de notre centre de d\\u00e9veloppement en Asie accompagne les PME et grands comptes dans de nombreux secteurs et dans une large gamme de services :","en":"DFM is a group offering activities and services in software development, scientific and computer engineering","vn":"DFM cung c\\u1ea5p c\\u00e1c d\\u1ecbch v\\u1ee5 ph\\u00e1t tri\\u1ec3n ph\\u1ea7n m\\u1ec1m, t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt v\\u00e0 c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '4', 'web.applications.logiciels.systmes.connectsembarqus', '{"x":"Web-applications, logiciels & syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s","en":"Web-app, software & connected\\/embedded systems","vn":"Web \\u1ee9ng d\\u1ee5ng, Ph\\u1ea7n m\\u1ec1m v\\u00e0 h\\u1ec7 th\\u1ed1ng c\\u00e1c thi\\u1ebft b\\u1ecb t\\u1ef1 \\u0111\\u1ed9ng"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '5', 'dfm.propose.une.solution.globale.permettant.dassurer.le.dveloppement.de.votre.outil.informatique.ddi.connect..votre.environnement.propre.serveur.smartphone.etc.des.systmes.connectsembarqus.peuvent.galement.la.complter', '{"x":"DFM propose une solution globale permettant d\\u2019assurer le d\\u00e9veloppement de votre outil informatique d\\u00e9di\\u00e9, connect\\u00e9 \\u00e0 votre environnement propre (serveur, smartphone etc). Des syst\\u00e8mes connect\\u00e9s\\/embarqu\\u00e9s peuvent \\u00e9galement la compl\\u00e9ter.","en":"DFM offers a global solution to ensure the development of your dedicated IT tool, connected to your own environment (server, smartphone etc). Connected \\/ embedded systems can also complement it.","vn":"DFM \\u0111\\u1ec1 xu\\u1ea5t gi\\u1ea3i ph\\u00e1p to\\u00e0n di\\u1ec7n \\u0111\\u1ec3 \\u0111\\u1ea3m b\\u1ea3o s\\u1ef1 ph\\u00e1t tri\\u1ec3n c\\u1ee7a c\\u00e1c c\\u00f4ng c\\u1ee5 c\\u00f4ng ngh\\u1ec7 th\\u00f4ng tin chuy\\u00ean d\\u1ee5ng c\\u1ee7a kh\\u00e1ch h\\u00e0ng, k\\u1ebft n\\u1ed1i v\\u1edbi m\\u00f4i tr\\u01b0\\u1eddng s\\u1eb5n c\\u00f3 c\\u1ee7a kh\\u00e1ch h\\u00e0ng (m\\u00e1y ch\\u1ee7, \\u0111i\\u1ec7n tho\\u1ea1i th\\u00f4ng minh, vv). H\\u1ec7 th\\u1ed1ng c\\u00e1c thi\\u1ebft b\\u1ecb t\\u1ef1 \\u0111\\u1ed9ng c\\u0169ng c\\u00f3 th\\u1ec3 b\\u1ed5 sung nh\\u1eb1m ho\\u00e0n thi\\u1ec7n gi\\u1ea3i ph\\u00e1p."}' );
