INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '8', 'dfm.dispose.des.comptences.rd.dingnierie.qui.lui.permette.de.vous.proposer.des.expriences.vr..partir.doutils.existants.ou.dvelopps.sur.mesure', '{"x":"DFM dispose des comp\\u00e9tences R&D, d\'ing\\u00e9nierie qui lui  permette de vous proposer des exp\\u00e9riences VR \\u00e0 partir d\\u2019outils existants ou d\\u00e9velopp\\u00e9s sur mesure.","en":"Our R & D and engineering capabilities enable us to offer you VR experiments using existing or customized tools.","vn":"V\\u1edbi n\\u0103ng l\\u1ef1c chuy\\u00ean m\\u00f4n v\\u1ec1 nghi\\u00ean c\\u1ee9u v\\u00e0 ph\\u00e1t tri\\u1ec3n, t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt cho ph\\u00e9p ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t cho kh\\u00e1ch h\\u00e0ng nh\\u1eefng tr\\u1ea3i nghi\\u1ec7m tuy\\u1ec7t v\\u1eddi c\\u1ee7a c\\u00f4ng ngh\\u1ec7 th\\u1ef1c t\\u1ebf \\u1ea3o nh\\u1edd v\\u00e0o nh\\u1eefng thi\\u1ebft b\\u1ecb s\\u1eb5n c\\u00f3 v\\u00e0 nh\\u1eefng thi\\u1ebft b\\u1ecb s\\u1ebd \\u0111\\u01b0\\u1ee3c ph\\u00e1t tri\\u1ec3n theo nhu c\\u1ea7u c\\u1ee7a th\\u1ecb tr\\u01b0\\u1eddng"}' );
