INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '10', 'calculs.scientifiques.ddis', '{"x":"Calculs scientifiques d\\u00e9di\\u00e9s","en":"Dedicated scientific approach","vn":"T\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '11', 'de.la.mcanique.conception.validation..la.mcanique.des.fluides.tout.en.intgrant.les.couplages.complexes.dfm.se.positionne.comme.un.interlocuteur.privilgi.aronautique.dfense.transport.nergie.en.apportant.une.rponse.ddie.et.experte', '{"x":"De la m\\u00e9canique (conception- validation) \\u00e0 la m\\u00e9canique des fluides tout en int\\u00e9grant les couplages complexes, DFM se positionne comme un interlocuteur privil\\u00e9gi\\u00e9 (a\\u00e9ronautique, d\\u00e9fense, transport, \\u00e9nergie, \\u2026) en apportant une r\\u00e9ponse d\\u00e9di\\u00e9e et experte.","en":"DFM is positioned as a privileged interlocutor (aeronautics, defense, transport, energy, ...) by providing a dedicated and expert response from mechanical (design-validation) to fluid mechanics while integrating complex couplings.","vn":"T\\u00ednh to\\u00e1n s\\u1ee9c b\\u1ec1n (thi\\u1ebft k\\u1ebf- ki\\u1ec3m duy\\u1ec7t), \\u0111\\u1ed9ng l\\u1ef1c h\\u1ecdc l\\u01b0u ch\\u1ea5t, DFM l\\u00e0 chuy\\u00ean gia trong c\\u00e1c l\\u0129nh v\\u1ef1c c\\u00f4ng nghi\\u1ec7p \\u0111\\u1eb7c th\\u00f9 (h\\u00e0ng kh\\u00f4ng v\\u0169 tr\\u1ee5, qu\\u1ed1c ph\\u00f2ng, giao th\\u00f4ng v\\u1eadn t\\u1ea3i, n\\u0103ng l\\u01b0\\u1ee3ng, ...)."}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '12', 'nos.valeurs', '{"x":"Nos valeurs","en":"Our values","vn":"Gi\\u00e1 tr\\u1ecb c\\u1ed1t l\\u00f5i"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '13', 'dfm.est.un.groupe.proposant.des.activits.et.des.services.en.dveloppement.logiciel.ingnierie.scientifique.et.informatique', '{"x":"DFM est un groupe proposant des activit\\u00e9s et des services en d\\u00e9veloppement logiciel, ing\\u00e9nierie scientifique et informatique","en":"DFM is a group providing services in software development, scientific and computer engineering. At the heart of the stakes of our customers, in a close relationship, our experts assisted by our development center in Asia are close to SMEs and large accounts in many sectors and in a wide range of services: ","vn":"DFM-Engineering l\\u00e0 c\\u00f4ng ty t\\u01b0 v\\u1ea5n k\\u1ef9 thu\\u1eadt v\\u00e0 vi\\u1ebft ph\\u1ea7n m\\u1ec1m. \\u0110\\u1ed9i ng\\u0169 chuy\\u00ean gia c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n s\\u00e1t c\\u00e1nh c\\u00f9ng kh\\u00e1ch h\\u00e0ng nh\\u1eb1m mang \\u0111\\u1ebfn cho kh\\u00e1ch h\\u00e0ng c\\u00e1c gi\\u1ea3i ph\\u00e1p nhanh ch\\u00f3ng, hi\\u1ec7u qu\\u1ea3, s\\u1ef1 \\u0111\\u1ed5i m\\u1edbi trong c\\u00e1c d\\u1ecbch v\\u1ee5 c\\u00f4ng nghi\\u1ec7p. Ch\\u00fang t\\u00f4i h\\u1ed7 tr\\u1ee3 s\\u1ef1 ph\\u00e1t tri\\u1ec3n cho c\\u00e1c doanh nghi\\u1ec7p t\\u1eeb doanh nghi\\u1ec7p v\\u1eeba v\\u00e0 nh\\u1ecf \\u1edf Ch\\u00e2u \\u00c1 cho \\u0111\\u1ebfn c\\u00e1c c\\u00f4ng ty l\\u1edbn ho\\u1ea1t \\u0111\\u1ed9ng trong nhi\\u1ec1u l\\u0129nh v\\u1ef1c v\\u00e0 trong m\\u1ed9t lo\\u1ea1t c\\u00e1c d\\u1ecbch v\\u1ee5:"}' );
