INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '64', 'nos.quipes.de.rd.travaillent.au.quotidien.avec.des.grands.nom.du.cac40.pour.les.aider..dvelopper.des.nouveaux.modles.encore.plus.prcis.et.encore.plus.complets.les.approches.multi.physiques.sont.plus.particulirement.vises.interaction.fluidestru...', '{"x":"Nos \\u00e9quipes de R&D travaillent au quotidien avec des grands nom du CAC40 pour les aider \\u00e0 d\\u00e9velopper des nouveaux mod\\u00e8les encore plus pr\\u00e9cis et encore plus complets, les approches multi-physiques sont plus particuli\\u00e8rement vis\\u00e9es: interaction fluide\\/structure, m\\u00e9canique du vol, \\u00e9coulement diphasiques\\u2026 autant de domaines pour lesquels les forts couplages rendent les mod\\u00e8les num\\u00e9riques d\\u00e9licats","en":"Our R & D teams work on a daily basis with major names in the CAC40 to helping them to develop comprehensive new models. Multi-physical approaches are more specifically targeted: fluid-structure interaction, flight mechanics, two-phase flow ... so many areas where strong coupling make numerical models tricky","vn":"\\u0110\\u1ed9i ng\\u0169 nghi\\u00ean c\\u1ee9u & ph\\u00e1t tri\\u1ec3n c\\u1ee7a ch\\u00fang t\\u00f4i l\\u00e0m vi\\u1ec7c h\\u00e0ng ng\\u00e0y v\\u1edbi ch\\u1ec9 s\\u1ed1 CAC40 nh\\u1eb1m h\\u1ed7 tr\\u1ee3 s\\u1ef1 ph\\u00e1t tri\\u1ec3n c\\u00e1c m\\u00f4 h\\u00ecnh m\\u1edbi ch\\u00ednh x\\u00e1c h\\u01a1n v\\u00e0 \\u0111\\u1ea7y \\u0111\\u1ee7 h\\u01a1n, ti\\u1ebfp c\\u1eadn \\u0111a v\\u1eadt l\\u00fd h\\u01b0\\u1edbng t\\u1edbi m\\u1ee5c ti\\u00eau c\\u1ee5 th\\u1ec3 l\\u00e0: t\\u01b0\\u01a1ng t\\u00e1c l\\u01b0u ch\\u1ea5t \\/ k\\u1ebft c\\u1ea5u, c\\u01a1 ch\\u1ebf bay, d\\u00f2ng ch\\u1ea3y \\u0111a pha, m\\u00f4 h\\u00ecnh d\\u00f2ng ch\\u1ea3y r\\u1ed1i \\u2026 "}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '65', 'loptimation.et.la.prcision.la.gestion.des.datas.ou.encore.le.dveloppement.de.procdure.de.validation.automatique.est.au.cur.de.nos.reflexions.nos.mathmaticiens.sont..loeuvre', '{"x":"L\\u2019optimation et la pr\\u00e9cision, la gestion des datas ou encore le d\\u00e9veloppement de proc\\u00e9dure de validation automatique est au c\\u0153ur de nos reflexions.  Nos math\\u00e9maticiens sont \\u00e0 l\\u2019oeuvre!","en":"Optimization and accuracy, data management and the development of automatic validation procedures are at the heart of our reflections. Our mathematicians are at work!","vn":"T\\u1ed1i \\u01b0u h\\u00f3a v\\u00e0 chi ti\\u1ebft, qu\\u1ea3n l\\u00fd c\\u00e1c d\\u1eef li\\u1ec7u ho\\u1eb7c ph\\u00e1t tri\\u1ec3n c\\u00e1c quy tr\\u00ecnh x\\u00e1c nh\\u1eadn t\\u1ef1 \\u0111\\u1ed9ng l\\u00e0 m\\u1ee5c ti\\u00eau m\\u00e0 ch\\u00fang t\\u00f4i h\\u01b0\\u1edbng t\\u1edbi. C\\u00e1c nh\\u00e0 to\\u00e1n h\\u1ecdc c\\u1ee7a ch\\u00fang t\\u00f4i lu\\u00f4n \\u1edf \\u0111\\u00e2y n\\u1ed7 l\\u1ef1c h\\u1ebft m\\u00ecnh \\u0111\\u1ec3 th\\u1ef1c hi\\u1ec7n m\\u1ee5c ti\\u00eau!"}' );
INSERT INTO `rainlab_translate_messages`(`id`,`code`,`message_data`) VALUES ( '67', 'lexpertise.scientifique.de.nos.quipes.nous.permet.de.proposer.des.dveloppements.de.codes.scientifiques.adapts..la.demande.de.nos.clients.p.plavantage.est.pour.nos.partenaires.de.disposer.dun.logiciel.complet.intgrant.les.besoins.et.saffranchissa...', '{"x":"L\\u2019expertise scientifique de nos \\u00e9quipes nous permet de proposer des d\\u00e9veloppements de codes scientifiques adapt\\u00e9s \\u00e0 la demande de nos clients...<\\/p>\\n                    <p>L\\u2019avantage est pour nos partenaires de disposer d\\u2019un logiciel complet int\\u00e9grant les besoins et s\\u2019affranchissant d\\u2019achat de licences souvent co\\u00fbteuse.","en":"The scientific expertise of our teams allows us to propose development of scientific codes adapted to the demand of our customers ... The advantage is for our partners to have a complete software integrating the exact needs without purchasing expensive licenses.","vn":"V\\u1edbi \\u0111\\u1ed9i ng\\u0169 chuy\\u00ean gia k\\u1ef9 thu\\u1eadt cho ph\\u00e9p ch\\u00fang t\\u00f4i \\u0111\\u1ec1 xu\\u1ea5t ph\\u00e1t tri\\u1ec3n c\\u00e1c code k\\u1ef9 thu\\u1eadt ph\\u00f9 h\\u1ee3p v\\u1edbi y\\u00eau c\\u1ea7u c\\u1ee7a kh\\u00e1ch h\\u00e0ng.   Ch\\u00fang t\\u00f4i mang \\u0111\\u1ebfn cho kh\\u00e1ch h\\u00e0ng m\\u1ed9t ph\\u1ea7n m\\u1ec1m t\\u1ed5ng th\\u1ec3 ph\\u00f9 h\\u1ee3p v\\u1edbi nhu c\\u1ea7u v\\u00e0 gi\\u00fap kh\\u00e1ch h\\u00e0ng ti\\u1ebft ki\\u1ec7m \\u0111\\u01b0\\u1ee3c chi ph\\u00ed t\\u1eeb vi\\u1ec7c c\\u1ea5p ph\\u00e9p b\\u1ea3n quy\\u1ec1n ph\\u1ea7n m\\u1ec1m. "}' );
